import React from 'react'

function PersonalPage() {
  const {setPagination} = useContext(AppContext)
  const navigate = useNavigate();
  function previous() {
    setPagination((i) => (i -= 1));
    navigate('/babyplanner')
  }
  function next() {
    setPagination((i) => (i += 1));
    navigate('/home')
  }
  return (
    <div><h1>This is my personal page</h1>
    {/* <div className="buttons">  
          <button onClick={previous} className="btn1">
            Babyplanner
          </button>
          <button type="submit" className="btn">
            Save result
          </button>
          <button onClick={next} className="btn2">
            Home
          </button>
          </div> */}
    </div>
  )
}

export default PersonalPage
